    encodedUrl = encodedUrl.replaceAll("`", "%60");
    encodedUrl = encodedUrl.replaceAll(" ", "%20");
    int qMarkIx = encodedUrl.indexOf('?');
    if (qMarkIx > 0) {
        encodedUrl = encodedUrl.substring(0, qMarkIx) + encodedUrl.substring(qMarkIx).replaceAll(":", "%3A");
    }
